	add("floccinaucinihilipilification", "{\"term\":\"floccinaucinihilipilification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027flocci\u0027, from \u0027floccus\u0027 (a wisp) + \u0027nauci\u0027, from \u0027naucum\u0027 (a trifle) + \u0027nihili\u0027, from \u0027nihil\u0027 (nothing) + \u0027pili\u0027, from \u0027pilus\u0027 (a hair) (all having the sense of \u0026quot;pettiness\u0026quot; or \u0026quot;nothing\u0026quot;) + -fication.A jocular coinage, apparently by pupils at w:Eton College|Eton College, combining a number of roughly synonymous Latin stems. The word was inspired by a line in the \u0027Eton Latin Grammar\u0027 that gave a rule for certain verbs that take an object in the genitive case: \u0026quot;Flocci, nauci, nihili, pili, assis, hujus, teruncii, his verbis, aestimo, pendo, facio, peculiariter adduntur.\u0026quot;\u0026lt;ref\u0026gt;\u0027The Spectator\u0027: 11 June 2011\u0026lt;/ref\u0026gt; This translates literally to: \u0026quot;To these words‚Äîaestimo, pendo and facio‚Äîirregularly are joined flocci, nauci, nihili, pili, assis, hujus and teruncii.‚Äù Or more loosely, \u0026quot;The verbs aestimo, pendo and facio when used in the sense of ‚Äúto value‚Äù or ‚Äúto care‚Äù irregularly take the following objects in the genitive case: flocci, nauci, nihili, pili, assis (a ‚Äúpenny‚Äù), hujus (this) and teruncii (a ‚Äúfarthing‚Äù).\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or habit of describing or regarding something as unimportant, of having no value or being worthless\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1741:\u0027\u0027 w:William William Shenstone, \u0027Letters\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I loved him for nothing so much as his \u0027\u0027flocci-nauci-nihili-pili-fication\u0027\u0027 of money\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027: w:Patrick Patrick O\u0027Brian, \u0027Master and Commander\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"There is a systematic \u0027\u0027flocci-nauci-nihili-pilification\u0027\u0027 of all other aspects of existence that angers me\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027: Raymond J. Chambers, \u0027Logic, Law, and Ethics\u0027[http://books.google.com/books?id\u003dEi03tgPKEKcC\u0026amp;lpg\u003dPA28\u0026amp;dq\u003dfloccinaucinihilipilification\u0026amp;pg\u003dPA2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dfloccinaucinihilipilification\u0026amp;f\u003dfalse\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Floccinaucinihilipilification\u0027\u0027 in accounting - does it matter\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027: Sol Steinmetz, \u0027The life of language\u0027[http://books.google.com/books?id\u003draN6AAAAIAAJ\u0026amp;q\u003dfloccinaucinihilipilification\u0026amp;dq\u003dfloccinaucinihilipilification\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003ddS8BU4bIMcTWyQHf94GwDw\u0026amp;ved\u003d0CKsBEOgBMBc4PA\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"They must be taken with an air of contempt, a \u0027\u0027floccinaucinihilipilification\u0027\u0027 of all that can gratify the outward man\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027: Judith Orloff, \u0027Emotional Freedom\u0027[http://books.google.com/books?id\u003d_V53VntvlmQC\u0026amp;lpg\u003dPA312\u0026amp;dq\u003dfloccinaucinihilipilification\u0026amp;pg\u003dPA31\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dfloccinaucinihilipilification\u0026amp;f\u003dfalse\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Some people with low self-esteem are prone to \u0027\u0027floccinaucinihilipilification\u0027\u0027, the habit of deeming everything worthless\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027: Bruce Ratner, \u0027Statistical and Machine-Learning Data Mining\u0027[http://books.google.com/books?id\u003dI3KZCfmhWJwC\u0026amp;lpg\u003dPT42\u0026amp;dq\u003dfloccinaucinihilipilification\u0026amp;pg\u003dPT4\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dfloccinaucinihilipilification\u0026amp;f\u003dfalse\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The quasi statistician would doubtlessly not know how to check this supposition, thus rendering the interpretation of the mean profit as \u0027\u0027floccinaucinihilipilification\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2012:\u0027\u0027 w:Jacob Jacob Rees-Mogg, \u0027Hansard\u0027[http://www.publications.parliament.uk/pa/cm201212/cmhansrd/cm120221/debtext/120221-0002.ht\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"12022155000158\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Let me indulge in the \u0027\u0027floccinaucinihilipilification\u0027\u0027 of EU judges and quote from the book of Amos about them\", \"priority\":19}]}, \"synonyms\":{}}");

