	add("florida", "{\"term\":\"florida\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"From Spanish a shortening of either {{m|es|florida|la Florida|the flowery one}} or {{m|es|Pascua Florida||flowery Easter}}.\u0026lt;ref name\u003d\u0026quot;PDL\u0026quot;\u0026gt;Steven Otfinoski, \u0027Juan Ponce de Leon: Discoverer of Florida\u0027 (2004, ISBN 07614161020, page 38\u0026lt;/ref\u0026gt; It is the oldest surviving European-given place-name in the US.\u0026lt;ref\u0026gt;George Stewart, \u0027Names on the Land: A Historical Account of Place-Naming in the United States\u0027 (1945, New York: Random House), pages 11‚Äì13, 17, 18. {{m|en|Appalachia}} is the fourth-oldest.\u0026lt;/ref\u0026gt;\u0026lt;ref name\u003d\u0026quot;PDL\u0026quot;/\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The southeasternmost state of the United States of America. Capital: Tallahassee; largest city: Jacksonville\", \"priority\":1}]}, \"synonyms\":{}}");

